            const res=await axios.get(`http://127.0.0.1:8000/productapi/khaadi-female/?page=1`)
            setUser(res.json());

        }

        getData();
    },[]);





return(
    <>
    <h1>helooowoow</h1>

    {
        user.map((val)=>{
        return(
        <div className="cards">
        <div className="card">
        <h1>  {val.title}</h1>
            
           </div>
    </div>
       )
}
    

    )
    }
</>
)
}

